import React from "react";

const BookCard=({book, addToBookself})=>{
    return(
        <div className="book=card">
            <h3>{book.title}</h3>
            <p>{book.author_name?book.author_name.join(', ') : 'Unkown Author'}</p>
            <button onClick={()=>addToBookself(book)}>Add to BookSelf</button>
        </div>
    ) 
}
export default BookCard;
